INSERT INTO "public"."product_product_translation" ("id", "language_code", "title", "meta_title", "meta_description", "short_description", "description", "slug", "master_id", "description_editorjs") VALUES
(1, 'en', 'Toy Story', 'Toy Story', 'A cowboy doll is profoundly threatened and jealous when a new spaceman action figure supplants him as top toy in a boy''s bedroom.', NULL, NULL, 'toy-story', 1, '{"time": 1688931984.622859, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A cowboy doll is profoundly threatened and jealous when a new spaceman action figure supplants him as top toy in a boy''s bedroom."}, "type": "paragraph"}], "version": "2.26.5"}'),
(2, 'cs', 'Toy Story', 'Toy Story', 'Panenka kovboje je hluboce ohrožena a žárlí, když ji nová figurka kosmonauta vytlačí z pozice nejlepší hračky v chlapeckém pokoji.', NULL, NULL, 'toy-story', 1, '{"time": 1688931984.622872, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Panenka kovboje je hluboce ohrožena a žárlí, když ji nová figurka kosmonauta vytlačí z pozice nejlepší hračky v chlapeckém pokoji."}, "type": "paragraph"}], "version": "2.26.5"}'),
(3, 'en', 'Jumanji', 'Jumanji', 'When two kids find and play a magical board game, they release a man trapped in it for decades - and a host of dangers that can only be stopped by fin', NULL, NULL, 'jumanji', 2, '{"time": 1688931985.123601, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "When two kids find and play a magical board game, they release a man trapped in it for decades - and a host of dangers that can only be stopped by finishing the game."}, "type": "paragraph"}], "version": "2.26.5"}'),
(4, 'cs', 'Jumanji', 'Jumanji', 'Když dvě děti najdou a hrají kouzelnou deskovou hru, osvobodí muže, který v ní byl po desetiletí uvězněn - a spoustu nebezpečí, která lze zastavit pou', NULL, NULL, 'jumanji', 2, '{"time": 1688931985.123622, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Když dvě děti najdou a hrají kouzelnou deskovou hru, osvobodí muže, který v ní byl po desetiletí uvězněn - a spoustu nebezpečí, která lze zastavit pouze dokončením hry."}, "type": "paragraph"}], "version": "2.26.5"}'),
(5, 'en', 'Heat', 'Heat', 'A group of high-end professional thieves start to feel the heat from the LAPD when they unknowingly leave a clue at their latest heist.', NULL, NULL, 'heat', 6, '{"time": 1688931985.496267, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A group of high-end professional thieves start to feel the heat from the LAPD when they unknowingly leave a clue at their latest heist."}, "type": "paragraph"}], "version": "2.26.5"}'),
(6, 'cs', 'Heat', 'Heat', 'Skupině špičkových profesionálních zlodějů začne být horko od losangeleské policie, když při své poslední loupeži nevědomky zanechají stopu.', NULL, NULL, 'heat', 6, '{"time": 1688931985.496291, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Skupině špičkových profesionálních zlodějů začne být horko od losangeleské policie, když při své poslední loupeži nevědomky zanechají stopu."}, "type": "paragraph"}], "version": "2.26.5"}'),
(7, 'en', 'GoldenEye', 'GoldenEye', 'Years after a friend and fellow 00 agent is killed on a joint mission, a Russian crime syndicate steals a secret space-based weapons program known as ', NULL, NULL, 'goldeneye', 10, '{"time": 1688931986.711092, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Years after a friend and fellow 00 agent is killed on a joint mission, a Russian crime syndicate steals a secret space-based weapons program known as \"GoldenEye\" and James Bond has to stop them from using it."}, "type": "paragraph"}], "version": "2.26.5"}'),
(8, 'cs', 'GoldenEye', 'GoldenEye', 'Mnoho let poté, co je na společné misi zabit jeho přítel a kolega agent 00, ukradne ruský zločinecký syndikát tajný vesmírný zbraňový program známý ja', NULL, NULL, 'goldeneye', 10, '{"time": 1688931986.711114, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Mnoho let poté, co je na společné misi zabit jeho přítel a kolega agent 00, ukradne ruský zločinecký syndikát tajný vesmírný zbraňový program známý jako \"GoldenEye\" a James Bond jim musí zabránit v jeho použití."}, "type": "paragraph"}], "version": "2.26.5"}'),
(9, 'en', 'Casino', 'Casino', 'A tale of greed, deception, money, power, and murder occur between two best friends: a mafia enforcer and a casino executive compete against each othe', NULL, NULL, 'casino', 16, '{"time": 1688931988.064165, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A tale of greed, deception, money, power, and murder occur between two best friends: a mafia enforcer and a casino executive compete against each other over a gambling empire, and over a fast-living and fast-loving socialite."}, "type": "paragraph"}], "version": "2.26.5"}'),
(10, 'cs', 'Casino', 'Casino', 'Příběh o chamtivosti, podvodech, penězích, moci a vraždách se odehrává mezi dvěma nejlepšími přáteli: mafiánský vymahač a ředitel kasina spolu soupeří', NULL, NULL, 'casino', 16, '{"time": 1688931988.064185, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Příběh o chamtivosti, podvodech, penězích, moci a vraždách se odehrává mezi dvěma nejlepšími přáteli: mafiánský vymahač a ředitel kasina spolu soupeří o impérium hazardních her a o rychle žijící a rychle milující společenskou smetánku."}, "type": "paragraph"}], "version": "2.26.5"}'),
(11, 'en', 'Sense and Sensibility', 'Sense and Sensibility', 'Rich Mr. Dashwood dies, leaving his second wife and her three daughters poor by the rules of inheritance. The two eldest daughters are the title oppos', NULL, NULL, 'sense-and-sensibility', 17, '{"time": 1688931988.432147, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Rich Mr. Dashwood dies, leaving his second wife and her three daughters poor by the rules of inheritance. The two eldest daughters are the title opposites."}, "type": "paragraph"}], "version": "2.26.5"}'),
(12, 'cs', 'Sense and Sensibility', 'Sense and Sensibility', 'Bohatý pan Dashwood umírá a zanechává svou druhou ženu a její tři dcery chudé podle pravidel dědictví. Dvě nejstarší dcery jsou titulními protihráčkam', NULL, NULL, 'sense-and-sensibility', 17, '{"time": 1688931988.432157, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Bohatý pan Dashwood umírá a zanechává svou druhou ženu a její tři dcery chudé podle pravidel dědictví. Dvě nejstarší dcery jsou titulními protihráčkami."}, "type": "paragraph"}], "version": "2.26.5"}'),
(13, 'en', 'Ace Ventura: When Nature Calls', 'Ace Ventura: When Nature Calls', 'Ace Ventura, Pet Detective, returns from a spiritual quest to investigate the disappearance of a rare white bat, the sacred animal of a tribe in Afric', NULL, NULL, 'ace-ventura-when-nature-calls', 19, '{"time": 1688931989.381172, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Ace Ventura, Pet Detective, returns from a spiritual quest to investigate the disappearance of a rare white bat, the sacred animal of a tribe in Africa."}, "type": "paragraph"}], "version": "2.26.5"}'),
(14, 'cs', 'Ace Ventura: When Nature Calls', 'Ace Ventura: When Nature Calls', 'Zvířecí detektiv Ace Ventura se vrací z duchovní výpravy, aby vyšetřil zmizení vzácného bílého netopýra, posvátného zvířete jednoho afrického kmene.', NULL, NULL, 'ace-ventura-when-nature-calls', 19, '{"time": 1688931989.381185, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Zvířecí detektiv Ace Ventura se vrací z duchovní výpravy, aby vyšetřil zmizení vzácného bílého netopýra, posvátného zvířete jednoho afrického kmene."}, "type": "paragraph"}], "version": "2.26.5"}'),
(15, 'en', 'City of Lost Children, The (Cité des enfants perdus, La)', 'City of Lost Children, The (Cité des enfants perdus, La)', 'A scientist in a surrealist society kidnaps children to steal their dreams, hoping that they slow his aging process.', NULL, NULL, 'city-of-lost-children-the-cite-des-enfants-perdus-la', 29, '{"time": 1688931989.75472, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A scientist in a surrealist society kidnaps children to steal their dreams, hoping that they slow his aging process."}, "type": "paragraph"}], "version": "2.26.5"}'),
(16, 'cs', 'City of Lost Children, The (Cité des enfants perdus, La)', 'City of Lost Children, The (Cité des enfants perdus, La)', 'Vědec v surrealistické společnosti unáší děti, aby jim ukradl sny, a doufá, že zpomalí jeho stárnutí.', NULL, NULL, 'city-of-lost-children-the-cite-des-enfants-perdus-la', 29, '{"time": 1688931989.754736, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Vědec v surrealistické společnosti unáší děti, aby jim ukradl sny, a doufá, že zpomalí jeho stárnutí."}, "type": "paragraph"}], "version": "2.26.5"}'),
(17, 'en', 'Twelve Monkeys (a.k.a. 12 Monkeys)', 'Twelve Monkeys (a.k.a. 12 Monkeys)', 'In a future world devastated by disease, a convict is sent back in time to gather information about the man-made virus that wiped out most of the huma', NULL, NULL, 'twelve-monkeys-aka-12-monkeys', 32, '{"time": 1688931990.216912, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "In a future world devastated by disease, a convict is sent back in time to gather information about the man-made virus that wiped out most of the human population on the planet."}, "type": "paragraph"}], "version": "2.26.5"}'),
(18, 'cs', 'Twelve Monkeys (a.k.a. 12 Monkeys)', 'Twelve Monkeys (a.k.a. 12 Monkeys)', 'Ve světě budoucnosti, který je zničen nemocemi, je odsouzenec vyslán zpět v čase, aby shromáždil informace o viru, který byl způsoben člověkem a který', NULL, NULL, 'twelve-monkeys-aka-12-monkeys', 32, '{"time": 1688931990.216934, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Ve světě budoucnosti, který je zničen nemocemi, je odsouzenec vyslán zpět v čase, aby shromáždil informace o viru, který byl způsoben člověkem a který vyhubil většinu lidské populace na planetě."}, "type": "paragraph"}], "version": "2.26.5"}'),
(19, 'en', 'Babe', 'Babe', 'Babe, a pig raised by sheepdogs on a rural English farm, learns to herd sheep with a little help from Farmer Hoggett.', NULL, NULL, 'babe', 34, '{"time": 1688931991.07861, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Babe, a pig raised by sheepdogs on a rural English farm, learns to herd sheep with a little help from Farmer Hoggett."}, "type": "paragraph"}], "version": "2.26.5"}'),
(20, 'cs', 'Babe', 'Babe', 'Babe, prase vychovávané ovčáckými psy na venkovské farmě v Anglii, se s malou pomocí farmáře Hoggetta naučí pást ovce.', NULL, NULL, 'babe', 34, '{"time": 1688931991.078634, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Babe, prase vychovávané ovčáckými psy na venkovské farmě v Anglii, se s malou pomocí farmáře Hoggetta naučí pást ovce."}, "type": "paragraph"}], "version": "2.26.5"}'),
(21, 'en', 'Clueless', 'Clueless', 'Shallow, rich and socially successful Cher is at the top of her Beverly Hills high school''s pecking scale. Seeing herself as a matchmaker, Cher first ', NULL, NULL, 'clueless', 39, '{"time": 1688931991.434553, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Shallow, rich and socially successful Cher is at the top of her Beverly Hills high school''s pecking scale. Seeing herself as a matchmaker, Cher first coaxes two teachers into dating each other."}, "type": "paragraph"}], "version": "2.26.5"}'),
(22, 'cs', 'Clueless', 'Clueless', 'Mělká, bohatá a společensky úspěšná Cher je na vrcholu žebříčku nejlepších studentů své střední školy v Beverly Hills. Cher se považuje za dohazovačku', NULL, NULL, 'clueless', 39, '{"time": 1688931991.43457, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Mělká, bohatá a společensky úspěšná Cher je na vrcholu žebříčku nejlepších studentů své střední školy v Beverly Hills. Cher se považuje za dohazovačku a nejprve přemluví dva učitele, aby spolu chodili."}, "type": "paragraph"}], "version": "2.26.5"}'),
(23, 'en', 'Seven (a.k.a. Se7en)', 'Seven (a.k.a. Se7en)', 'Two detectives, a rookie and a veteran, hunt a serial killer who uses the seven deadly sins as his motives.', NULL, NULL, 'seven-aka-se7en', 47, '{"time": 1688931991.813942, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Two detectives, a rookie and a veteran, hunt a serial killer who uses the seven deadly sins as his motives."}, "type": "paragraph"}], "version": "2.26.5"}'),
(24, 'cs', 'Seven (a.k.a. Se7en)', 'Seven (a.k.a. Se7en)', 'Dva detektivové, nováček a veterán, pátrají po sériovém vrahovi, jehož motivem je sedm smrtelných hříchů.', NULL, NULL, 'seven-aka-se7en', 47, '{"time": 1688931991.813953, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Dva detektivové, nováček a veterán, pátrají po sériovém vrahovi, jehož motivem je sedm smrtelných hříchů."}, "type": "paragraph"}], "version": "2.26.5"}'),
(25, 'en', 'Usual Suspects, The', 'Usual Suspects, The', 'A sole survivor tells of the twisty events leading up to a horrific gun battle on a boat, which began when five criminals met at a seemingly random po', NULL, NULL, 'usual-suspects-the', 50, '{"time": 1688931992.258461, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A sole survivor tells of the twisty events leading up to a horrific gun battle on a boat, which began when five criminals met at a seemingly random police lineup."}, "type": "paragraph"}], "version": "2.26.5"}'),
(26, 'cs', 'Usual Suspects, The', 'Usual Suspects, The', 'Jediný přeživší vypráví o spletitých událostech, které vedly k děsivé přestřelce na lodi, jež začala, když se pět zločinců setkalo na zdánlivě náhodné', NULL, NULL, 'usual-suspects-the', 50, '{"time": 1688931992.258468, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Jediný přeživší vypráví o spletitých událostech, které vedly k děsivé přestřelce na lodi, jež začala, když se pět zločinců setkalo na zdánlivě náhodné policejní schůzce."}, "type": "paragraph"}], "version": "2.26.5"}'),
(27, 'en', 'From Dusk Till Dawn', 'From Dusk Till Dawn', 'Two criminals and their hostages unknowingly seek temporary refuge in a truck stop populated by vampires, with chaotic results.', NULL, NULL, 'from-dusk-till-dawn', 70, '{"time": 1688931992.630233, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Two criminals and their hostages unknowingly seek temporary refuge in a truck stop populated by vampires, with chaotic results."}, "type": "paragraph"}], "version": "2.26.5"}'),
