(497, 'en', 'Ghost World', 'Ghost World', 'With only the plan of moving in together after high school, two unusually devious friends seek direction in life. As a mere gag, they respond to a man', NULL, NULL, 'ghost-world', 4641, '{"time": 1688932108.575629, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "With only the plan of moving in together after high school, two unusually devious friends seek direction in life. As a mere gag, they respond to a man''s newspaper ad for a date, only to find it will greatly complicate their lives."}, "type": "paragraph"}], "version": "2.26.5"}');
