(498, 'cs', 'Ghost World', 'Ghost World', 'Dvě neobyčejně prohnané kamarádky, které mají v plánu se po střední škole přestěhovat k sobě, hledají životní směr. Jako na pouhý žert zareagují na in', NULL, NULL, 'ghost-world', 4641, '{"time": 1688932108.575643, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Dvě neobyčejně prohnané kamarádky, které mají v plánu se po střední škole přestěhovat k sobě, hledají životní směr. Jako na pouhý žert zareagují na inzerát v novinách, v němž muž nabízí rande, aby zjistily, že jim to značně zkomplikuje život."}, "type": "paragraph"}], "version": "2.26.5"}'),
(499, 'en', 'Planet of the Apes', 'Planet of the Apes', 'In 2029, an Air Force astronaut crash-lands on a mysterious planet where evolved, talking apes dominate a race of primitive humans.', NULL, NULL, 'planet-of-the-apes', 4643, '{"time": 1688932109.510017, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "In 2029, an Air Force astronaut crash-lands on a mysterious planet where evolved, talking apes dominate a race of primitive humans."}, "type": "paragraph"}], "version": "2.26.5"}'),
(500, 'cs', 'Planet of the Apes', 'Planet of the Apes', 'V roce 2029 přistane astronaut letectva na záhadné planetě, kde vyspělé mluvící opice ovládají rasu primitivních lidí.', NULL, NULL, 'planet-of-the-apes', 4643, '{"time": 1688932109.510035, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "V roce 2029 přistane astronaut letectva na záhadné planetě, kde vyspělé mluvící opice ovládají rasu primitivních lidí."}, "type": "paragraph"}], "version": "2.26.5"}');
