(510, 'cs', 'Jay and Silent Bob Strike Back', 'Jay and Silent Bob Strike Back', 'Komiks "Bluntman a Chronic" je založen na skutečných zhulencích Jayovi a Mlčenlivém Bobovi, takže když jim adaptace na velkém plátně nepřinesla žádný ', NULL, NULL, 'jay-and-silent-bob-strike-back', 4734, '{"time": 1688932111.451911, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Komiks \"Bluntman a Chronic\" je založen na skutečných zhulencích Jayovi a Mlčenlivém Bobovi, takže když jim adaptace na velkém plátně nepřinesla žádný zisk, rozhodli se film zničit."}, "type": "paragraph"}], "version": "2.26.5"}'),
