(969, 'en', 'Inconvenient Truth, An', 'Inconvenient Truth, An', 'Filmmaker Davis Guggenheim follows Al Gore on the lecture circuit, as the former presidential candidate campaigns to raise public awareness of the dan', NULL, NULL, 'inconvenient-truth-an', 45950, '{"time": 1688932226.817495, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Filmmaker Davis Guggenheim follows Al Gore on the lecture circuit, as the former presidential candidate campaigns to raise public awareness of the dangers of global warming and calls for immediate action to curb its destructive effects on the environment."}, "type": "paragraph"}], "version": "2.26.5"}'),
(970, 'cs', 'Inconvenient Truth, An', 'Inconvenient Truth, An', 'Režisér Davis Guggenheim sleduje Al Gora na jeho přednáškách, kde se bývalý kandidát na prezidenta snaží zvýšit povědomí veřejnosti o nebezpečí globál', NULL, NULL, 'inconvenient-truth-an', 45950, '{"time": 1688932226.817502, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Režisér Davis Guggenheim sleduje Al Gora na jeho přednáškách, kde se bývalý kandidát na prezidenta snaží zvýšit povědomí veřejnosti o nebezpečí globálního oteplování a vyzývá k okamžitým krokům k omezení jeho ničivých dopadů na životní prostředí."}, "type": "paragraph"}], "version": "2.26.5"}'),
(971, 'en', 'Little Miss Sunshine', 'Little Miss Sunshine', 'A family determined to get their young daughter into the finals of a beauty pageant take a cross-country trip in their VW bus.', NULL, NULL, 'little-miss-sunshine', 46578, '{"time": 1688932227.283099, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A family determined to get their young daughter into the finals of a beauty pageant take a cross-country trip in their VW bus."}, "type": "paragraph"}], "version": "2.26.5"}'),
(972, 'cs', 'Little Miss Sunshine', 'Little Miss Sunshine', 'Rodina odhodlaná dostat svou malou dceru do finále soutěže krásy se vydává na cestu napříč zemí ve svém autobusu VW.', NULL, NULL, 'little-miss-sunshine', 46578, '{"time": 1688932227.283116, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Rodina odhodlaná dostat svou malou dceru do finále soutěže krásy se vydává na cestu napříč zemí ve svém autobusu VW."}, "type": "paragraph"}], "version": "2.26.5"}'),
(973, 'en', 'Babel', 'Babel', 'Tragedy strikes a married couple on vacation in the Moroccan desert, touching off an interlocking story involving four different families.', NULL, NULL, 'babel', 46723, '{"time": 1688932228.16692, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Tragedy strikes a married couple on vacation in the Moroccan desert, touching off an interlocking story involving four different families."}, "type": "paragraph"}], "version": "2.26.5"}'),
(974, 'cs', 'Babel', 'Babel', 'Manželský pár na dovolené v marocké poušti postihne tragédie, která odstartuje příběh, do něhož se zapojí čtyři různé rodiny.', NULL, NULL, 'babel', 46723, '{"time": 1688932228.167011, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Manželský pár na dovolené v marocké poušti postihne tragédie, která odstartuje příběh, do něhož se zapojí čtyři různé rodiny."}, "type": "paragraph"}], "version": "2.26.5"}'),
(975, 'en', 'Talladega Nights: The Ballad of Ricky Bobby', 'Talladega Nights: The Ballad of Ricky Bobby', 'Number one NASCAR driver Ricky Bobby stays atop the heap thanks to a pact with his best friend and teammate, Cal Naughton, Jr. But when a French Formu', NULL, NULL, 'talladega-nights-the-ballad-of-ricky-bobby', 46970, '{"time": 1688932229.050651, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Number one NASCAR driver Ricky Bobby stays atop the heap thanks to a pact with his best friend and teammate, Cal Naughton, Jr. But when a French Formula One driver, makes his way up the ladder, Ricky Bobby''s talent and devotion are put to the test."}, "type": "paragraph"}], "version": "2.26.5"}'),
(976, 'cs', 'Talladega Nights: The Ballad of Ricky Bobby', 'Talladega Nights: The Ballad of Ricky Bobby', 'Jednička NASCAR Ricky Bobby zůstává na vrcholu díky dohodě se svým nejlepším přítelem a týmovým kolegou Calem Naughtonem Jr. Když se však do čela žebř', NULL, NULL, 'talladega-nights-the-ballad-of-ricky-bobby', 46970, '{"time": 1688932229.050669, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Jednička NASCAR Ricky Bobby zůstává na vrcholu díky dohodě se svým nejlepším přítelem a týmovým kolegou Calem Naughtonem Jr. Když se však do čela žebříčku dostane francouzský jezdec Formule 1, je talent a oddanost Rickyho Bobbyho podrobena zkoušce."}, "type": "paragraph"}], "version": "2.26.5"}'),
(977, 'en', 'Night at the Museum', 'Night at the Museum', 'A newly recruited night security guard at the Museum of Natural History discovers that an ancient curse causes the animals and exhibits on display to ', NULL, NULL, 'night-at-the-museum', 46972, '{"time": 1688932229.526699, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A newly recruited night security guard at the Museum of Natural History discovers that an ancient curse causes the animals and exhibits on display to come to life and wreak havoc."}, "type": "paragraph"}], "version": "2.26.5"}'),
(978, 'cs', 'Night at the Museum', 'Night at the Museum', 'Nově přijatý noční hlídač v Přírodovědném muzeu zjistí, že starodávná kletba způsobuje, že vystavená zvířata a exponáty ožívají a působí spoušť.', NULL, NULL, 'night-at-the-museum', 46972, '{"time": 1688932229.526725, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Nově přijatý noční hlídač v Přírodovědném muzeu zjistí, že starodávná kletba způsobuje, že vystavená zvířata a exponáty ožívají a působí spoušť."}, "type": "paragraph"}], "version": "2.26.5"}'),
(979, 'en', 'Stranger than Fiction', 'Stranger than Fiction', 'I.R.S. auditor Harold Crick suddenly finds his mundane Chicago life to be the subject of narration only he can hear: narration that begins to affect h', NULL, NULL, 'stranger-than-fiction', 46976, '{"time": 1688932230.14432, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "I.R.S. auditor Harold Crick suddenly finds his mundane Chicago life to be the subject of narration only he can hear: narration that begins to affect his entire existence, from his work to his love life to his death."}, "type": "paragraph"}], "version": "2.26.5"}'),
(980, 'cs', 'Stranger than Fiction', 'Stranger than Fiction', 'Auditor I.R.S. Harold Crick náhle zjistí, že jeho všední život v Chicagu je předmětem vyprávění, které slyší jen on sám: vyprávění, které začíná ovliv', NULL, NULL, 'stranger-than-fiction', 46976, '{"time": 1688932230.144348, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Auditor I.R.S. Harold Crick náhle zjistí, že jeho všední život v Chicagu je předmětem vyprávění, které slyší jen on sám: vyprávění, které začíná ovlivňovat celou jeho existenci, od práce přes milostný život až po smrt."}, "type": "paragraph"}], "version": "2.26.5"}'),
(981, 'en', 'Pursuit of Happyness, The', 'Pursuit of Happyness, The', 'A struggling salesman takes custody of his son as he''s poised to begin a life-changing professional career.', NULL, NULL, 'pursuit-of-happyness-the', 47099, '{"time": 1688932230.537636, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A struggling salesman takes custody of his son as he''s poised to begin a life-changing professional career."}, "type": "paragraph"}], "version": "2.26.5"}'),
(982, 'cs', 'Pursuit of Happyness, The', 'Pursuit of Happyness, The', 'Prodavač, který se potýká s problémy, si vezme do péče svého syna v době, kdy se chystá zahájit profesní kariéru, která mu změní život.', NULL, NULL, 'pursuit-of-happyness-the', 47099, '{"time": 1688932230.537653, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Prodavač, který se potýká s problémy, si vezme do péče svého syna v době, kdy se chystá zahájit profesní kariéru, která mu změní život."}, "type": "paragraph"}], "version": "2.26.5"}'),
(983, 'en', 'Crank', 'Crank', 'Professional assassin Chev Chelios learns his rival has injected him with a poison that will kill him if his heart rate drops.', NULL, NULL, 'crank', 47200, '{"time": 1688932230.956057, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Professional assassin Chev Chelios learns his rival has injected him with a poison that will kill him if his heart rate drops."}, "type": "paragraph"}], "version": "2.26.5"}');
