(984, 'cs', 'Crank', 'Crank', 'Profesionální zabiják Chev Chelios se dozví, že mu jeho soupeř píchl jed, který ho zabije, pokud mu klesne tepová frekvence.', NULL, NULL, 'crank', 47200, '{"time": 1688932230.956085, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Profesionální zabiják Chev Chelios se dozví, že mu jeho soupeř píchl jed, který ho zabije, pokud mu klesne tepová frekvence."}, "type": "paragraph"}], "version": "2.26.5"}'),
(985, 'en', 'Illusionist, The', 'Illusionist, The', 'In turn-of-the-century Vienna, a magician uses his abilities to secure the love of a woman far above his social standing.', NULL, NULL, 'illusionist-the', 47610, '{"time": 1688932231.912008, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "In turn-of-the-century Vienna, a magician uses his abilities to secure the love of a woman far above his social standing."}, "type": "paragraph"}], "version": "2.26.5"}'),
(986, 'cs', 'Illusionist, The', 'Illusionist, The', 'Ve Vídni na přelomu 19. a 20. století využívá kouzelník svých schopností k tomu, aby si zajistil lásku ženy, která je mnohem výše než on.', NULL, NULL, 'illusionist-the', 47610, '{"time": 1688932231.912035, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Ve Vídni na přelomu 19. a 20. století využívá kouzelník svých schopností k tomu, aby si zajistil lásku ženy, která je mnohem výše než on."}, "type": "paragraph"}], "version": "2.26.5"}'),
(987, 'en', 'The Queen', 'The Queen', 'After the death of Princess Diana, Queen Elizabeth II struggles with her reaction to a sequence of events nobody could have predicted.', NULL, NULL, 'the-queen', 47629, '{"time": 1688932232.271124, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "After the death of Princess Diana, Queen Elizabeth II struggles with her reaction to a sequence of events nobody could have predicted."}, "type": "paragraph"}], "version": "2.26.5"}'),
(988, 'cs', 'The Queen', 'The Queen', 'Po smrti princezny Diany se královna Alžběta II. potýká s reakcí na sled událostí, které nikdo nemohl předvídat.', NULL, NULL, 'the-queen', 47629, '{"time": 1688932232.271133, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Po smrti princezny Diany se královna Alžběta II. potýká s reakcí na sled událostí, které nikdo nemohl předvídat."}, "type": "paragraph"}], "version": "2.26.5"}'),
(989, 'en', 'Idiocracy', 'Idiocracy', 'Corporal Joe Bauers, a decisively average American, is selected as a guinea pig for a top-secret hibernation program but is forgotten, awakening to a ', NULL, NULL, 'idiocracy', 47997, '{"time": 1688932232.803261, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Corporal Joe Bauers, a decisively average American, is selected as a guinea pig for a top-secret hibernation program but is forgotten, awakening to a future so incredibly moronic he''s easily the most intelligent person alive."}, "type": "paragraph"}], "version": "2.26.5"}'),
(990, 'cs', 'Idiocracy', 'Idiocracy', 'Desátník Joe Bauers, rozhodně průměrný Američan, je vybrán jako pokusný králík do přísně tajného hibernačního programu, ale je zapomenut a probouzí se', NULL, NULL, 'idiocracy', 47997, '{"time": 1688932232.80329, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Desátník Joe Bauers, rozhodně průměrný Američan, je vybrán jako pokusný králík do přísně tajného hibernačního programu, ale je zapomenut a probouzí se do budoucnosti tak neuvěřitelně debilní, že je snadno nejinteligentnějším člověkem na světě."}, "type": "paragraph"}], "version": "2.26.5"}'),
(991, 'en', 'Fountain, The', 'Fountain, The', 'As a modern-day scientist, Tommy is struggling with mortality, desperately searching for the medical breakthrough that will save the life of his cance', NULL, NULL, 'fountain-the', 48043, '{"time": 1688932233.236171, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "As a modern-day scientist, Tommy is struggling with mortality, desperately searching for the medical breakthrough that will save the life of his cancer-stricken wife, Izzi."}, "type": "paragraph"}], "version": "2.26.5"}'),
(992, 'cs', 'Fountain, The', 'Fountain, The', 'Tommy jako novodobý vědec bojuje se smrtelností a zoufale hledá průlomový lékařský objev, který by zachránil život jeho rakovinou postižené ženy Izzi.', NULL, NULL, 'fountain-the', 48043, '{"time": 1688932233.236197, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Tommy jako novodobý vědec bojuje se smrtelností a zoufale hledá průlomový lékařský objev, který by zachránil život jeho rakovinou postižené ženy Izzi."}, "type": "paragraph"}], "version": "2.26.5"}'),
(993, 'en', 'Science of Sleep, The (La science des rêves)', 'Science of Sleep, The (La science des rêves)', 'A man entranced by his dreams and imagination is love-struck with a French woman and feels he can show her his world.', NULL, NULL, 'science-of-sleep-the-la-science-des-reves', 48082, '{"time": 1688932233.622743, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A man entranced by his dreams and imagination is love-struck with a French woman and feels he can show her his world."}, "type": "paragraph"}], "version": "2.26.5"}'),
(994, 'cs', 'Science of Sleep, The (La science des rêves)', 'Science of Sleep, The (La science des rêves)', 'Muž okouzlený svými sny a představami se zamiluje do Francouzky a má pocit, že jí může ukázat svůj svět.', NULL, NULL, 'science-of-sleep-the-la-science-des-reves', 48082, '{"time": 1688932233.623241, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Muž okouzlený svými sny a představami se zamiluje do Francouzky a má pocit, že jí může ukázat svůj svět."}, "type": "paragraph"}], "version": "2.26.5"}'),
(995, 'en', 'Apocalypto', 'Apocalypto', 'As the Mayan kingdom faces its decline, a young man is taken on a perilous journey to a world ruled by fear and oppression.', NULL, NULL, 'apocalypto', 48304, '{"time": 1688932234.004394, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "As the Mayan kingdom faces its decline, a young man is taken on a perilous journey to a world ruled by fear and oppression."}, "type": "paragraph"}], "version": "2.26.5"}'),
(996, 'cs', 'Apocalypto', 'Apocalypto', 'V době, kdy mayské království čelí úpadku, se mladý muž vydává na nebezpečnou cestu do světa, kde vládne strach a útlak.', NULL, NULL, 'apocalypto', 48304, '{"time": 1688932234.004412, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "V době, kdy mayské království čelí úpadku, se mladý muž vydává na nebezpečnou cestu do světa, kde vládne strach a útlak."}, "type": "paragraph"}], "version": "2.26.5"}'),
(997, 'en', 'Borat: Cultural Learnings of America for Make Benefit Glorious Nation of Kazakhstan', 'Borat: Cultural Learnings of America for Make Benefit Glorious Nation of Kazakhstan', 'Kazakh TV talking head Borat is dispatched to the United States to report on the greatest country in the world. With a documentary crew in tow, Borat ', NULL, NULL, 'borat-cultural-learnings-of-america-for-make-benefit-glorious-nation-of-kazakhstan', 48385, '{"time": 1688932234.346292, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Kazakh TV talking head Borat is dispatched to the United States to report on the greatest country in the world. With a documentary crew in tow, Borat becomes more interested in locating and marrying Pamela Anderson."}, "type": "paragraph"}], "version": "2.26.5"}'),
(998, 'cs', 'Borat: Cultural Learnings of America for Make Benefit Glorious Nation of Kazakhstan', 'Borat: Cultural Learnings of America for Make Benefit Glorious Nation of Kazakhstan', 'Kazašská televizní hlava Borat je vyslána do Spojených států, aby podala zprávu o největší zemi na světě. S dokumentárním štábem v závěsu se Borat zač', NULL, NULL, 'borat-cultural-learnings-of-america-for-make-benefit-glorious-nation-of-kazakhstan', 48385, '{"time": 1688932234.346318, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Kazašská televizní hlava Borat je vyslána do Spojených států, aby podala zprávu o největší zemi na světě. S dokumentárním štábem v závěsu se Borat začne zajímat spíše o to, jak najít a oženit se s Pamelou Andersonovou."}, "type": "paragraph"}], "version": "2.26.5"}'),
(999, 'en', 'Pan''s Labyrinth (Laberinto del fauno, El)', 'Pan''s Labyrinth (Laberinto del fauno, El)', 'In the Falangist Spain of 1944, the bookish young stepdaughter of a sadistic army officer escapes into an eerie but captivating fantasy world.', NULL, NULL, 'pans-labyrinth-laberinto-del-fauno-el', 48394, '{"time": 1688932234.756043, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "In the Falangist Spain of 1944, the bookish young stepdaughter of a sadistic army officer escapes into an eerie but captivating fantasy world."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1000, 'cs', 'Pan''s Labyrinth (Laberinto del fauno, El)', 'Pan''s Labyrinth (Laberinto del fauno, El)', 'Ve falangistickém Španělsku roku 1944 uniká mladá knihomolská nevlastní dcera sadistického armádního důstojníka do děsivého, ale podmanivého světa fan', NULL, NULL, 'pans-labyrinth-laberinto-del-fauno-el', 48394, '{"time": 1688932234.756054, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Ve falangistickém Španělsku roku 1944 uniká mladá knihomolská nevlastní dcera sadistického armádního důstojníka do děsivého, ale podmanivého světa fantazie."}, "type": "paragraph"}], "version": "2.26.5"}');
