(1001, 'en', 'Departed, The', 'Departed, The', 'An undercover cop and a mole in the police attempt to identify each other while infiltrating an Irish gang in South Boston.', NULL, NULL, 'departed-the', 48516, '{"time": 1688932235.133007, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "An undercover cop and a mole in the police attempt to identify each other while infiltrating an Irish gang in South Boston."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1002, 'cs', 'Departed, The', 'Departed, The', 'Policista v utajení a policejní špeh se při infiltraci irského gangu v jižním Bostonu snaží vzájemně identifikovat.', NULL, NULL, 'departed-the', 48516, '{"time": 1688932235.133026, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Policista v utajení a policejní špeh se při infiltraci irského gangu v jižním Bostonu snaží vzájemně identifikovat."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1003, 'en', 'Last King of Scotland, The', 'Last King of Scotland, The', 'Based on the events of the brutal Ugandan dictator Idi Amin''s regime as seen by his personal physician during the 1970s.', NULL, NULL, 'last-king-of-scotland-the', 48738, '{"time": 1688932235.481484, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Based on the events of the brutal Ugandan dictator Idi Amin''s regime as seen by his personal physician during the 1970s."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1004, 'cs', 'Last King of Scotland, The', 'Last King of Scotland, The', 'Film vychází z událostí brutálního režimu ugandského diktátora Idi Amina, jak je viděl jeho osobní lékař v 70. letech.', NULL, NULL, 'last-king-of-scotland-the', 48738, '{"time": 1688932235.48151, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Film vychází z událostí brutálního režimu ugandského diktátora Idi Amina, jak je viděl jeho osobní lékař v 70. letech."}, "type": "paragraph"}], "version": "2.26.5"}'),
