(1489, 'en', 'Exam', 'Exam', 'Eight candidates for a highly desirable corporate job are locked together in an exam room and given a final test with just one seemingly simple questi', NULL, NULL, 'exam', 78349, '{"time": 1688932374.47729, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Eight candidates for a highly desirable corporate job are locked together in an exam room and given a final test with just one seemingly simple question. However, it doesn''t take long for confusion to ensue and tensions to unravel."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1490, 'cs', 'Exam', 'Exam', 'Osm uchazečů o velmi žádané pracovní místo ve firmě je zavřeno ve zkušební místnosti a čeká je závěrečný test s jedinou zdánlivě jednoduchou otázkou. ', NULL, NULL, 'exam', 78349, '{"time": 1688932374.477312, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Osm uchazečů o velmi žádané pracovní místo ve firmě je zavřeno ve zkušební místnosti a čeká je závěrečný test s jedinou zdánlivě jednoduchou otázkou. Netrvá však dlouho a dojde ke zmatku a napětí."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1491, 'en', 'A-Team, The', 'A-Team, The', 'A group of Iraq War veterans look to clear their name with the U.S. Military, who suspect the four men of committing a crime for which they were frame', NULL, NULL, 'a-team-the', 78469, '{"time": 1688932375.297016, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A group of Iraq War veterans look to clear their name with the U.S. Military, who suspect the four men of committing a crime for which they were framed."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1492, 'cs', 'A-Team, The', 'A-Team, The', 'Skupina veteránů z války v Iráku se snaží očistit své jméno u americké armády, která čtveřici mužů podezřívá ze spáchání zločinu, který na ně byl nast', NULL, NULL, 'a-team-the', 78469, '{"time": 1688932375.297035, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Skupina veteránů z války v Iráku se snaží očistit své jméno u americké armády, která čtveřici mužů podezřívá ze spáchání zločinu, který na ně byl nastražen."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1493, 'en', 'Toy Story 3', 'Toy Story 3', 'The toys are mistakenly delivered to a day-care center instead of the attic right before Andy leaves for college, and it''s up to Woody to convince the', NULL, NULL, 'toy-story-3', 78499, '{"time": 1688932376.470912, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "The toys are mistakenly delivered to a day-care center instead of the attic right before Andy leaves for college, and it''s up to Woody to convince the other toys that they weren''t abandoned and to return home."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1494, 'cs', 'Toy Story 3', 'Toy Story 3', 'Těsně před Andyho odjezdem na vysokou školu jsou hračky omylem doručeny do školky místo na půdu a je na Woodym, aby ostatní hračky přesvědčil, že neby', NULL, NULL, 'toy-story-3', 78499, '{"time": 1688932376.470936, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Těsně před Andyho odjezdem na vysokou školu jsou hračky omylem doručeny do školky místo na půdu a je na Woodym, aby ostatní hračky přesvědčil, že nebyly opuštěné, a vrátil se domů."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1495, 'en', 'Winter''s Bone', 'Winter''s Bone', 'An unflinching Ozark Mountain girl hacks through dangerous social terrain as she hunts down her drug-dealing father while trying to keep her family in', NULL, NULL, 'winters-bone', 78574, '{"time": 1688932376.967335, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "An unflinching Ozark Mountain girl hacks through dangerous social terrain as she hunts down her drug-dealing father while trying to keep her family intact."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1496, 'cs', 'Winter''s Bone', 'Winter''s Bone', 'Nezdolná dívka z hor Ozark Mountain se prodírá nebezpečným sociálním terénem, když pátrá po svém otci, který prodává drogy, a zároveň se snaží udržet ', NULL, NULL, 'winters-bone', 78574, '{"time": 1688932376.967355, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Nezdolná dívka z hor Ozark Mountain se prodírá nebezpečným sociálním terénem, když pátrá po svém otci, který prodává drogy, a zároveň se snaží udržet svou rodinu neporušenou."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1497, 'en', 'Shrek Forever After (a.k.a. Shrek: The Final Chapter)', 'Shrek Forever After (a.k.a. Shrek: The Final Chapter)', 'Rumpelstiltskin tricks a mid-life crisis burdened Shrek into allowing himself to be erased from existence and cast in a dark alternate timeline where ', NULL, NULL, 'shrek-forever-after-aka-shrek-the-final-chapter', 78637, '{"time": 1688932377.440197, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Rumpelstiltskin tricks a mid-life crisis burdened Shrek into allowing himself to be erased from existence and cast in a dark alternate timeline where Rumpelstiltskin rules supreme."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1498, 'cs', 'Shrek Forever After (a.k.a. Shrek: The Final Chapter)', 'Shrek Forever After (a.k.a. Shrek: The Final Chapter)', 'Rampelník přiměje Shreka, který prožívá krizi středního věku, aby se nechal vymazat z existence a přenesl se do temné alternativní časové linie, kde v', NULL, NULL, 'shrek-forever-after-aka-shrek-the-final-chapter', 78637, '{"time": 1688932377.440217, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Rampelník přiměje Shreka, který prožívá krizi středního věku, aby se nechal vymazat z existence a přenesl se do temné alternativní časové linie, kde vládne Rampelník."}, "type": "paragraph"}], "version": "2.26.5"}'),
