(1501, 'en', 'Enter the Void', 'Enter the Void', 'An American drug dealer living in Tokyo is betrayed by his best friend and killed in a drug deal. His soul, observing the repercussions of his death, ', NULL, NULL, 'enter-the-void', 78836, '{"time": 1688932378.223348, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "An American drug dealer living in Tokyo is betrayed by his best friend and killed in a drug deal. His soul, observing the repercussions of his death, seeks resurrection."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1502, 'cs', 'Enter the Void', 'Enter the Void', 'Americký drogový dealer žijící v Tokiu je zrazen svým nejlepším přítelem a zabit při obchodu s drogami. Jeho duše, která sleduje následky jeho smrti, ', NULL, NULL, 'enter-the-void', 78836, '{"time": 1688932378.223366, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Americký drogový dealer žijící v Tokiu je zrazen svým nejlepším přítelem a zabit při obchodu s drogami. Jeho duše, která sleduje následky jeho smrti, se snaží o vzkříšení."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1503, 'en', 'South Park: Imaginationland', 'South Park: Imaginationland', 'In this never-before-seen Director''s Cut, the doors of the world''s imagination are thrown wide open and the boys of South Park are transported to a ma', NULL, NULL, 'south-park-imaginationland', 79008, '{"time": 1688932379.144336, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "In this never-before-seen Director''s Cut, the doors of the world''s imagination are thrown wide open and the boys of South Park are transported to a magical realm in their greatest odyssey ever."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1504, 'cs', 'South Park: Imaginationland', 'South Park: Imaginationland', 'V této dosud neviděné Director''s Cut se dveře světové fantazie otevírají dokořán a chlapci ze South Parku se ve své největší odysee přenesou do kouzel', NULL, NULL, 'south-park-imaginationland', 79008, '{"time": 1688932379.144355, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "V této dosud neviděné Director''s Cut se dveře světové fantazie otevírají dokořán a chlapci ze South Parku se ve své největší odysee přenesou do kouzelné říše."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1505, 'en', 'Predators', 'Predators', 'A group of elite warriors parachute into an unfamiliar jungle and are hunted by members of a merciless alien race.', NULL, NULL, 'predators', 79057, '{"time": 1688932379.490023, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A group of elite warriors parachute into an unfamiliar jungle and are hunted by members of a merciless alien race."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1506, 'cs', 'Predators', 'Predators', 'Skupina elitních válečníků seskočí padákem do neznámé džungle a je pronásledována příslušníky nemilosrdné mimozemské rasy.', NULL, NULL, 'predators', 79057, '{"time": 1688932379.490051, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Skupina elitních válečníků seskočí padákem do neznámé džungle a je pronásledována příslušníky nemilosrdné mimozemské rasy."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1507, 'en', 'Despicable Me', 'Despicable Me', 'When a criminal mastermind uses a trio of orphan girls as pawns for a grand scheme, he finds their love is profoundly changing him for the better.', NULL, NULL, 'despicable-me', 79091, '{"time": 1688932380.363111, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "When a criminal mastermind uses a trio of orphan girls as pawns for a grand scheme, he finds their love is profoundly changing him for the better."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1508, 'cs', 'Despicable Me', 'Despicable Me', 'Když zločinecký mozek využije trojici osiřelých dívek jako pěšáky pro svůj velkolepý plán, zjistí, že jejich láska ho zásadně mění k lepšímu.', NULL, NULL, 'despicable-me', 79091, '{"time": 1688932380.363139, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Když zločinecký mozek využije trojici osiřelých dívek jako pěšáky pro svůj velkolepý plán, zjistí, že jejich láska ho zásadně mění k lepšímu."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1509, 'en', 'Inception', 'Inception', 'A thief who steals corporate secrets through the use of dream-sharing technology is given the inverse task of planting an idea into the mind of a C.E.', NULL, NULL, 'inception', 79132, '{"time": 1688932381.483449, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A thief who steals corporate secrets through the use of dream-sharing technology is given the inverse task of planting an idea into the mind of a C.E.O., but his tragic past may doom the project and his team to disaster."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1510, 'cs', 'Inception', 'Inception', 'Zloděj, který krade firemní tajemství pomocí technologie sdílení snů, dostane inverzní úkol - vštípit myšlenku do mysli výkonného ředitele, ale jeho t', NULL, NULL, 'inception', 79132, '{"time": 1688932381.48347, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Zloděj, který krade firemní tajemství pomocí technologie sdílení snů, dostane inverzní úkol - vštípit myšlenku do mysli výkonného ředitele, ale jeho tragická minulost může projekt i jeho tým odsoudit ke katastrofě."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1511, 'en', 'Sorcerer''s Apprentice, The', 'Sorcerer''s Apprentice, The', 'Balthazar Blake, an apprentice of the legendary magician Merlin, must train his old teacher''s successor - an introverted but resourceful physics prodi', NULL, NULL, 'sorcerers-apprentice-the', 79139, '{"time": 1688932382.819116, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Balthazar Blake, an apprentice of the legendary magician Merlin, must train his old teacher''s successor - an introverted but resourceful physics prodigy - in the art of sorcery to prevent the return of Morgana le Fay."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1512, 'cs', 'Sorcerer''s Apprentice, The', 'Sorcerer''s Apprentice, The', 'Balthazar Blake, učedník legendárního kouzelníka Merlina, musí vycvičit nástupce svého starého učitele - introvertního, ale vynalézavého fyzikálního z', NULL, NULL, 'sorcerers-apprentice-the', 79139, '{"time": 1688932382.819135, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Balthazar Blake, učedník legendárního kouzelníka Merlina, musí vycvičit nástupce svého starého učitele - introvertního, ale vynalézavého fyzikálního zázraku - v kouzelnickém umění, aby zabránil návratu Morgany le Fay."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1513, 'en', 'Knight and Day', 'Knight and Day', 'A young woman gets mixed up with a disgraced spy who is trying to clear his name.', NULL, NULL, 'knight-and-day', 79185, '{"time": 1688932383.171773, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A young woman gets mixed up with a disgraced spy who is trying to clear his name."}, "type": "paragraph"}], "version": "2.26.5"}'),
