(1516, 'cs', 'Karate Kid, The', 'Karate Kid, The', 'Matka samoživitelka se kvůli práci přestěhuje se svým malým synem do Číny; v novém domově se chlapec věnuje kung-fu, které ho učí mistr.', NULL, NULL, 'karate-kid-the', 79224, '{"time": 1688932383.594309, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Matka samoživitelka se kvůli práci přestěhuje se svým malým synem do Číny; v novém domově se chlapec věnuje kung-fu, které ho učí mistr."}, "type": "paragraph"}], "version": "2.26.5"}'),
