(1958, 'cs', 'Way, Way Back, The', 'Way, Way Back, The', 'Nesmělý čtrnáctiletý Duncan jede na letní prázdniny se svou matkou, jejím panovačným přítelem a dcerou jejího přítele. Duncan má problém zapadnout do ', NULL, NULL, 'way-way-back-the', 102993, '{"time": 1688932500.389498, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Nesmělý čtrnáctiletý Duncan jede na letní prázdniny se svou matkou, jejím panovačným přítelem a dcerou jejího přítele. Duncan má problém zapadnout do kolektivu, a tak najde nečekaného přítele v Owenu, řediteli vodního parku Water Wizz."}, "type": "paragraph"}], "version": "2.26.5"}'),
