(1960, 'cs', 'Man of Steel', 'Man of Steel', 'Mimozemské dítě je evakuováno ze svého umírajícího světa a posláno na Zemi, aby žilo mezi lidmi. Jeho klid je ohrožen, když na Zemi vtrhnou další přež', NULL, NULL, 'man-of-steel', 103042, '{"time": 1688932500.753828, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Mimozemské dítě je evakuováno ze svého umírajícího světa a posláno na Zemi, aby žilo mezi lidmi. Jeho klid je ohrožen, když na Zemi vtrhnou další přeživší z jeho domovské planety."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1961, 'en', 'Kings of Summer, The', 'Kings of Summer, The', 'Three teenage friends, in the ultimate act of independence, decide to spend their summer building a house in the woods and living off the land.', NULL, NULL, 'kings-of-summer-the', 103048, '{"time": 1688932501.147194, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Three teenage friends, in the ultimate act of independence, decide to spend their summer building a house in the woods and living off the land."}, "type": "paragraph"}], "version": "2.26.5"}'),
