(1995, 'en', 'Blue Jasmine', 'Blue Jasmine', 'A New York socialite, deeply troubled and in denial, arrives in San Francisco to impose upon her sister. She looks like a million dollars but isn''t br', NULL, NULL, 'blue-jasmine', 103980, '{"time": 1688932512.864699, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "A New York socialite, deeply troubled and in denial, arrives in San Francisco to impose upon her sister. She looks like a million dollars but isn''t bringing money, peace or love."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1996, 'cs', 'Blue Jasmine', 'Blue Jasmine', 'Newyorská společenská smetánka, která má hluboké problémy a popírá je, přijíždí do San Franciska, aby se vnutila své sestře. Vypadá jako milion dolarů', NULL, NULL, 'blue-jasmine', 103980, '{"time": 1688932512.864719, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Newyorská společenská smetánka, která má hluboké problémy a popírá je, přijíždí do San Franciska, aby se vnutila své sestře. Vypadá jako milion dolarů, ale nepřináší peníze, klid ani lásku."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1997, 'en', 'Great Beauty, The (Grande Bellezza, La)', 'Great Beauty, The (Grande Bellezza, La)', 'Jep Gambardella has seduced his way through the lavish nightlife of Rome for decades, but after his 65th birthday and a shock from the past, Jep looks', NULL, NULL, 'great-beauty-the-grande-bellezza-la', 103984, '{"time": 1688932513.476868, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Jep Gambardella has seduced his way through the lavish nightlife of Rome for decades, but after his 65th birthday and a shock from the past, Jep looks past the nightclubs and parties to find a timeless landscape of absurd, exquisite beauty."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1998, 'cs', 'Great Beauty, The (Grande Bellezza, La)', 'Great Beauty, The (Grande Bellezza, La)', 'Jep Gambardella se po desetiletí prodíral opulentním nočním životem Říma, ale po svých 65. narozeninách a šoku z minulosti se Jep ohlédne za nočními k', NULL, NULL, 'great-beauty-the-grande-bellezza-la', 103984, '{"time": 1688932513.47688, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Jep Gambardella se po desetiletí prodíral opulentním nočním životem Říma, ale po svých 65. narozeninách a šoku z minulosti se Jep ohlédne za nočními kluby a večírky, aby našel nadčasovou krajinu absurdní, nádherné krásy."}, "type": "paragraph"}], "version": "2.26.5"}'),
(1999, 'en', 'Louis C.K.: Oh My God', 'Louis C.K.: Oh My God', 'In February, 2013, Louis brings his impish nihilism to Phoenix, Arizona. He talks about an old lady and her pet, living in Manhattan, experiencing his', NULL, NULL, 'louis-ck-oh-my-god', 104069, '{"time": 1688932514.967191, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "In February, 2013, Louis brings his impish nihilism to Phoenix, Arizona. He talks about an old lady and her pet, living in Manhattan, experiencing his body''s aging (he''s 45), men''s fascination with women''s breasts, the beauty of living outside the food chain, his quickness to anger while driving, and murder. It''s theater in the round, so he''s in constant motion, a grin nearly always on his face.—<jhailey@hotmail.com>"}, "type": "paragraph"}], "version": "2.26.5"}'),
(2000, 'cs', 'Louis C.K.: Oh My God', 'Louis C.K.: Oh My God', 'V únoru 2013 přiveze Louis svůj bezelstný nihilismus do Phoenixu v Arizoně. Vypráví o staré dámě a jejím domácím mazlíčkovi, o životě na Manhattanu, o', NULL, NULL, 'louis-ck-oh-my-god', 104069, '{"time": 1688932514.9672, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "V únoru 2013 přiveze Louis svůj bezelstný nihilismus do Phoenixu v Arizoně. Vypráví o staré dámě a jejím domácím mazlíčkovi, o životě na Manhattanu, o prožívání stárnutí svého těla (je mu 45 let), o fascinaci mužů ženskými ňadry, o kráse života mimo potravinový řetězec, o své rychlosti vzteku při řízení a o vraždě. Je to divadlo v kruhu, takže je v neustálém pohybu, na tváři má téměř neustále úsměv.\" -<jhailey@hotmail.com>"}, "type": "paragraph"}], "version": "2.26.5"}');
