(2029, 'en', 'Blue Is the Warmest Color (La vie d''Adèle)', 'Blue Is the Warmest Color (La vie d''Adèle)', 'Adèle''s life is changed when she meets Emma, a young woman with blue hair, who will allow her to discover desire and to assert herself as a woman and ', NULL, NULL, 'blue-is-the-warmest-color-la-vie-dadele', 105355, '{"time": 1688932524.846662, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Adèle''s life is changed when she meets Emma, a young woman with blue hair, who will allow her to discover desire and to assert herself as a woman and as an adult. In front of others, Adèle grows, seeks herself, loses herself, and ultimately finds herself through love and loss."}, "type": "paragraph"}], "version": "2.26.5"}'),
(2030, 'cs', 'Blue Is the Warmest Color (La vie d''Adèle)', 'Blue Is the Warmest Color (La vie d''Adèle)', 'Adèle se změní život, když potká Emmu, mladou ženu s modrými vlasy, která jí umožní objevit touhu a prosadit se jako žena i jako dospělá. Před zraky o', NULL, NULL, 'blue-is-the-warmest-color-la-vie-dadele', 105355, '{"time": 1688932524.846688, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Adèle se změní život, když potká Emmu, mladou ženu s modrými vlasy, která jí umožní objevit touhu a prosadit se jako žena i jako dospělá. Před zraky ostatních Adèle roste, hledá sama sebe, ztrácí se a nakonec nachází sama sebe skrze lásku a ztrátu."}, "type": "paragraph"}], "version": "2.26.5"}'),
