(2209, 'en', 'Tale of Princess Kaguya, The (Kaguyahime no monogatari)', 'Tale of Princess Kaguya, The (Kaguyahime no monogatari)', 'Found inside a shining stalk of bamboo by an old bamboo cutter and his wife, a tiny girl grows rapidly into an exquisite young lady. The mysterious yo', NULL, NULL, 'tale-of-princess-kaguya-the-kaguyahime-no-monogatari', 114554, '{"time": 1688932578.122858, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Found inside a shining stalk of bamboo by an old bamboo cutter and his wife, a tiny girl grows rapidly into an exquisite young lady. The mysterious young princess enthralls all who encounter her, but ultimately she must confront her fate, the punishment for her crime."}, "type": "paragraph"}], "version": "2.26.5"}'),
