(2220, 'cs', 'Predestination', 'Predestination', 'Při svém posledním úkolu musí špičkový časový agent pronásledovat jediného zločince, který mu po celou dobu unikal. Honička se změní v jedinečné, přek', NULL, NULL, 'predestination', 114935, '{"time": 1688932580.61522, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Při svém posledním úkolu musí špičkový časový agent pronásledovat jediného zločince, který mu po celou dobu unikal. Honička se změní v jedinečné, překvapivé a mysl ohromující zkoumání lásky, osudu, identity a tabu cestování v čase."}, "type": "paragraph"}], "version": "2.26.5"}'),
