(2481, 'en', 'Straight Outta Compton', 'Straight Outta Compton', 'The rap group NWA emerges from the mean streets of Compton in Los Angeles, California, in the mid-1980s and revolutionizes Hip Hop culture with their ', NULL, NULL, 'straight-outta-compton', 140715, '{"time": 1688932655.392894, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "The rap group NWA emerges from the mean streets of Compton in Los Angeles, California, in the mid-1980s and revolutionizes Hip Hop culture with their music and tales about life in the hood."}, "type": "paragraph"}], "version": "2.26.5"}'),
(2482, 'cs', 'Straight Outta Compton', 'Straight Outta Compton', 'V polovině 80. let 20. století se z ulic Comptonu v Los Angeles v Kalifornii vynořuje rapová skupina NWA, která svou hudbou a příběhy o životě v chudi', NULL, NULL, 'straight-outta-compton', 140715, '{"time": 1688932655.392917, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "V polovině 80. let 20. století se z ulic Comptonu v Los Angeles v Kalifornii vynořuje rapová skupina NWA, která svou hudbou a příběhy o životě v chudinské čtvrti způsobila revoluci v hiphopové kultuře."}, "type": "paragraph"}], "version": "2.26.5"}'),
