(2488, 'cs', 'The Danish Girl', 'The Danish Girl', 'Fiktivní milostný příběh volně inspirovaný životem dánských umělkyň Lili Elbe a Gerdy Wegener. Manželství a tvorba Lili a Gerdy se vyvíjejí v průběhu ', NULL, NULL, 'the-danish-girl', 141749, '{"time": 1688932657.185552, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Fiktivní milostný příběh volně inspirovaný životem dánských umělkyň Lili Elbe a Gerdy Wegener. Manželství a tvorba Lili a Gerdy se vyvíjejí v průběhu Liliiny průkopnické cesty jako průkopnice transgenderu."}, "type": "paragraph"}], "version": "2.26.5"}'),
