(2498, 'cs', 'Spotlight', 'Spotlight', 'Skutečný příběh o tom, jak deník Boston Globe odhalil rozsáhlý skandál zneužívání dětí a jeho krytí v místní katolické arcidiecézi, který otřásl celou', NULL, NULL, 'spotlight', 142488, '{"time": 1688932660.009889, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Skutečný příběh o tom, jak deník Boston Globe odhalil rozsáhlý skandál zneužívání dětí a jeho krytí v místní katolické arcidiecézi, který otřásl celou katolickou církví."}, "type": "paragraph"}], "version": "2.26.5"}'),
