(2937, 'en', 'BlacKkKlansman', 'BlacKkKlansman', 'Ron Stallworth, an African American police officer from Colorado Springs, CO, successfully manages to infiltrate the local Ku Klux Klan branch with th', NULL, NULL, 'blackkklansman', 189713, '{"time": 1688932776.391698, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Ron Stallworth, an African American police officer from Colorado Springs, CO, successfully manages to infiltrate the local Ku Klux Klan branch with the help of a Jewish surrogate who eventually becomes its leader. Based on actual events."}, "type": "paragraph"}], "version": "2.26.5"}'),
(2938, 'cs', 'BlacKkKlansman', 'BlacKkKlansman', 'Ronu Stallworthovi, afroamerickému policistovi z Colorado Springs v Kalifornii, se s pomocí židovského náhradníka, který se nakonec stane jeho vůdcem,', NULL, NULL, 'blackkklansman', 189713, '{"time": 1688932776.391708, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Ronu Stallworthovi, afroamerickému policistovi z Colorado Springs v Kalifornii, se s pomocí židovského náhradníka, který se nakonec stane jeho vůdcem, podaří infiltrovat místní pobočku Ku-klux-klanu. Film vychází ze skutečných událostí."}, "type": "paragraph"}], "version": "2.26.5"}'),
(2939, 'en', 'The Darkest Minds', 'The Darkest Minds', 'After a disease kills 98% of children, the survivors develop powers and are declared a threat. 16-year-old Ruby, escapes the government facility and j', NULL, NULL, 'the-darkest-minds', 190183, '{"time": 1688932776.772829, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "After a disease kills 98% of children, the survivors develop powers and are declared a threat. 16-year-old Ruby, escapes the government facility and joins a group of rebel teenagers ready to fight the government forces out to get them."}, "type": "paragraph"}], "version": "2.26.5"}'),
(2940, 'cs', 'The Darkest Minds', 'The Darkest Minds', 'Poté, co nemoc zabije 98 % dětí, se u těch, které přežily, vyvinou schopnosti a jsou prohlášeny za hrozbu. Šestnáctiletá Ruby uteče z vládního zařízen', NULL, NULL, 'the-darkest-minds', 190183, '{"time": 1688932776.772842, "blocks": [{"id": "D48CBYJh-n", "data": {"text": "Poté, co nemoc zabije 98 % dětí, se u těch, které přežily, vyvinou schopnosti a jsou prohlášeny za hrozbu. Šestnáctiletá Ruby uteče z vládního zařízení a připojí se ke skupině rebelujících teenagerů, kteří jsou připraveni bojovat proti vládním silám, které je chtějí dostat."}, "type": "paragraph"}], "version": "2.26.5"}');
